import React, { useState } from 'react';
import { FaSearch, FaBars } from 'react-icons/fa';
import { IoHome, IoListCircleOutline, IoBagShopping, IoNotificationsOutline, IoJournalism} from 'react-icons/io5';

const App = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('Spices Or Masala'); // Default category

  // Sample data (replace with your actual data)
  const categoriesData = [
    { id: 1, name: 'Spices Or Masala', image: 'https://via.placeholder.com/150' },
    { id: 2, name: 'Bathing Soaps', image: 'https://via.placeholder.com/150' },
    { id: 3, name: 'Baby Care', image: 'https://via.placeholder.com/150' },
    { id: 4, name: 'Hair Oil & Hair Cares', image: 'https://via.placeholder.com/150' },
    { id: 5, name: 'Toothpaste & Toothbrush', image: 'https://via.placeholder.com/150' },
    { id: 6, name: 'Shampoo & Conditioners', image: 'https://via.placeholder.com/150' },
    { id: 7, name: 'Perfumes', image: 'https://via.placeholder.com/150' },
  ];

  const productsData = [
    { id: 1, name: 'Everest Turmeric 200 Gram', category: 'Spices Or Masala', image: 'https://via.placeholder.com/200' },
    { id: 2, name: 'Patanjali Turmeric (Haldi) Powder 100 Gram', category: 'Spices Or Masala', image: 'https://via.placeholder.com/200' },
    { id: 3, name: 'Patanjali Sabji Masala 100 Gram', category: 'Spices Or Masala', image: 'https://via.placeholder.com/200' },
    { id: 4, name: 'Patanjali Cumin (Jeera) Powder', category: 'Spices Or Masala', image: 'https://via.placeholder.com/200' },
    // Add more products here
  ];

  const handleSearch = (event) => {
    const term = event.target.value;
    setSearchTerm(term);

    if (term) {
      const results = productsData.filter((product) =>
        product.name.toLowerCase().includes(term.toLowerCase())
      );
      setSearchResults(results);
    } else {
      setSearchResults([]); // Clear search results when the input is empty
    }
  };

  const handleCategoryClick = (categoryName) => {
    setSelectedCategory(categoryName);
  };

  const filteredProducts = selectedCategory === 'All'
    ? productsData
    : productsData.filter((product) => product.category === selectedCategory);


  return (
    <div style={{ fontFamily: 'Arial, sans-serif', backgroundColor: '#f8f9fa' }}>
      {/* Header */}
      <div style={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center', 
        padding: '10px',
        backgroundColor: '#fff'
       }}>
        <div>
          <input
            type="text"
            placeholder="Search for products..."
            value={searchTerm}
            onChange={handleSearch}
            style={{ border: '1px solid #ccc', padding: '8px', borderRadius: '4px', width: '300px' }}
          />
          <button style={{ backgroundColor: '#dc3545', color: '#fff', border: 'none', padding: '8px 12px', borderRadius: '4px', cursor: 'pointer' }}>
            <FaSearch /> Search
          </button>
        </div>

        <div>
           <IoBars/>
        </div>
      </div>

      {/* Top Categories */}
      <div style={{ display: 'flex', overflowX: 'auto', padding: '10px' }}>
        {categoriesData.map((category) => (
          <div
            key={category.id}
            style={{ 
              width: '150px', 
              marginRight: '10px', 
              border: '1px solid #eee', 
              borderRadius: '4px', 
              padding: '8px',
              cursor: 'pointer'
             }}
            onClick={() => handleCategoryClick(category.name)}
          >
            <img src={category.image} alt={category.name} style={{ width: '100%', height: '100px', objectFit: 'cover' }} />
            <p>{category.name}</p>
          </div>
        ))}
      </div>

      {/* Search Results or Filtered Products */}
      {searchTerm ? (
        <div style={{ padding: '10px' }}>
          <h2>Search Results</h2>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '20px' }}>
            {searchResults.map((product) => (
              <div key={product.id} style={{ border: '1px solid #eee', borderRadius: '4px', padding: '10px' }}>
                <img src={product.image} alt={product.name} style={{ width: '100%', height: '150px', objectFit: 'cover' }} />
                <h3>{product.name}</h3>
                <p>per unit</p>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <div style={{ padding: '10px' }}>
          <h2>{selectedCategory}</h2>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '20px' }}>
            {filteredProducts.map((product) => (
              <div key={product.id} style={{ border: '1px solid #eee', borderRadius: '4px', padding: '10px' }}>
                <img src={product.image} alt={product.name} style={{ width: '100%', height: '150px', objectFit: 'cover' }} />
                <h3>{product.name}</h3>
                <p>per unit</p>
              </div>
            ))}
          </div>
        </div>
      )}

       {/* Bottom Navigation */}
       <div style={{ 
         display: 'flex', 
         justifyContent: 'space-around', 
         alignItems: 'center', 
         padding: '10px',
         backgroundColor: '#fff',
         borderTop: '1px solid #eee'
        }}>
          <IoHome size={24} color="#333" />
          <IoListCircleOutline size={24} color="#333" />
          <IoBagShopping size={24} color="#333" />
          <IoNotificationsOutline size={24} color="#333" />
          <IoJournalism size={24} color="#333" />
        </div>
    </div>
  );
};

export default App;
